import { useForms } from "../../Providers/Forms";
import { Div } from "../../style";
interface IForms {
  code: number;
  category: string;
  name: string;
  provider: string;
  value: number;
  id: number;
}

function Card({ name, value, provider, code, category, id }: IForms) {
  const { removeProduct, data, editProduct, setData, editar } = useForms();

  return (
    <Div>
      <h3>{name}</h3>
      <p>{value}</p>
      <p> {provider}</p>
      <p> {code}</p>
      <p> {category}</p>
      <button onClick={() => removeProduct(id)}>Remover</button>
    </Div>
  );
}
export default Card;
